import { Component } from "react";
import Profile from "../img/profile.JPEG";

class Home extends Component {
  render() {
    return (
      <div className="flex gap-10">
        <div className="border w-[70%]">
          <h1>메인</h1>
        </div>
        <div className="border w-[30%]">
          <div className="grid grid-cols-3 items-center content-center">
            <div>
              <img src={Profile} className="w-20" alt="profile" />
            </div>
            <div className="w-40">
              <h1 className="font-semibold">이다혜 님</h1>
            </div>
            <div>
              <button className="bg-gray-400 hover:bg-gray-300 text-white font-bold py-2 px-4 rounded-full">
                로그아웃
              </button>
            </div>
          </div>
          <div className="grid grid-cols-2 bg-orange-400 text-center">
            <div>내 블로그</div>
            <div>글쓰기</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
